__NUXT_JSONP__("/drugs/Aclarubicin", (function(a,b){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"57576-44-0",chebiId:"",chemicalFormula:"C42H53NO15",definition:"An oligosaccharide anthracycline antineoplastic antibiotic isolated from the bacterium Streptomyces galilaeus. Aclarubicin intercalates into DNA and interacts with topoisomerases I and II, thereby inhibiting DNA replication and repair and RNA and protein synthesis. Aclarubicin is antagonistic to other agents that inhibit topoisomerase II, such as etoposide, teniposide and amsacrine. This agent is less cardiotoxic than doxorubicin and daunorubicin.",fdaUniiCode:"74KXF8I502",identifier:"C202",preferredName:a,semanticType:"Antibiotic",subclassOf:["C987"],synonyms:["(1R,2R,4S)-2-ethyl-1,2,3,4,6,11-hexahydro-2,5,7-trihydroxy-6,11-dioxo-4-[[2,3,6-trideoxy-4-O-[2,6-dideoxy-4-O-[(2R,trans)-tetrahydro-6-methyl-5-oxo-2H-pyran-2-yl]-alpha-L-lyxo-hexopyranosyl]-3-(dimethylamino)-alpha-L-lyxo-hexopyranosyl]oxy]-1-naphthacenecarboxylic acid methyl ester","1-naphthacenecarboxylic acid, 2-ethyl-1,2,3,4,6,11-hexahydro-2,5, 7-trihydroxy-6,11-dioxo-4-[[2,3,6-trideoxy-4-O-[2,6-dideoxy-4-O-((2R-trans)-tetrahydro-6-methyl-5-oxo-2H-pyran-2-yl) -alpha-L-lyxo-hexopyranosyl]-3-(dimethylamino)-alpha-L-lyxo-hexopyranosyl]oxy]-, methyl ester,(1R-(1alpha,2beta,4beta))-(9CI)","ACLARUBICIN","ACM-A","Aclacinomycin","Aclacinomycin A","Aclacinomycin-A",a,"Antibiotic MA144-A1","MA144-A1"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FAclarubicin",extension:".json",createdAt:b,updatedAt:b}}],fetch:{},mutations:void 0}}("Aclarubicin","2021-10-30T13:37:12.593Z")));